import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Header = ({ navLinks, logoSrc }) => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <header className="sticky top-0 z-50 bg-white/80 backdrop-blur-sm shadow-sm">
      <nav className="container mx-auto px-6 py-4 flex justify-between items-center">
        <Link to="/home" className="text-2xl font-bold text-[#3d405b]">
          {logoSrc ? (
            <img src={logoSrc} alt="SNS Club" className="h-10" />
          ) : (
            'SNS Club'
          )}
        </Link>

        <div className="hidden md:flex items-center space-x-6 text-lg">
          {navLinks.map((link, index) => (
            link.isButton ? (
              <Link
                key={index}
                to={link.href}
                className="bg-[#81b29a] text-white px-5 py-2 rounded-full hover:bg-[#6a9e87] transition-colors"
              >
                {link.text}
              </Link>
            ) : (
              <Link
                key={index}
                to={link.href}
                className="hover:text-[#e07a5f] transition-colors"
              >
                {link.text}
              </Link>
            )
          ))}
        </div>

        <button
          onClick={toggleMobileMenu}
          className="md:hidden text-2xl"
        >
          â˜°
        </button>
      </nav>

      {/* Mobile Menu */}
      <div className={`${mobileMenuOpen ? '' : 'hidden'} md:hidden px-6 pb-4`}>
        {navLinks.map((link, index) => (
          link.isButton ? (
            <Link
              key={index}
              to={link.href}
              className="block mt-2 bg-[#81b29a] text-white px-5 py-2 rounded-full text-center hover:bg-[#6a9e87] transition-colors"
              onClick={() => setMobileMenuOpen(false)}
            >
              {link.text}
            </Link>
          ) : (
            <Link
              key={index}
              to={link.href}
              className="block py-2 hover:text-[#e07a5f] transition-colors"
              onClick={() => setMobileMenuOpen(false)}
            >
              {link.text}
            </Link>
          )
        ))}
      </div>
    </header>
  );
};

export default Header;
